import { experience } from "../Data/data";
import { ExperienceModel } from "../Data/types";

const Experience = () => {
    return (
        <>
        {experience.map(item => (
            <div className="" style={{color: "#888D91"}}>
                <p style={{color: "#98FBFC"}}>{item.role} - <span style={{color: "#158CE1"}}>WebstaurantStore</span></p>
                <p style={{color: "#235588"}}>2021 - Present</p>
                <p>
                    Developed robust software engineer with a passion for developing intuitive and user-friendly 
                    interfaces that deliver exceptional user experiences that exceed both the expectations of 
                    clients and end-users.
                </p>
                <p>React</p>
            </div>
        ))}
        </>
    )
}

export default Experience;
